script: |
  super -f text -I q12759.spq | sort > q12759.out

inputs:
  - name: q12759.spq
    data: |
      SELECT DISTINCT - 63 / COUNT ( * ) * - COUNT ( * ) AS col2 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q12759.out
    data: |
      63
